import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import BlogList from './components/BlogList'; // Adjust the path as needed
import BlogDetail from './components/BlogDetail'; // Adjust the path as needed
import BlogCreate from './components/BlogCreate'; // Adjust the path as needed


function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact component={BlogList} />
          <Route path="/blogs/:id" component={BlogDetail} />
          <Route path="/create" component={BlogCreate} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
